import React from 'react';
import { Redirect, Route, useParams } from 'react-router-dom';

const {id}= useParams()
console.log(id)
const Restricted = ({ component: Cmp, ...rest }) => (


        <Route
        {...rest}
        render={(props) =>
            localStorage.getItem('createId')
                ? <Redirect to="/sharelink"/>
                :(<Cmp {...props} />)
        }
    />

)
export default Restricted;
